    public void add(String result,int index){
        JSONArray array = JSONArray.parseArray(result);
        JSONArray array1 = array.getJSONObject(0).getJSONArray("data");
        List<ProductCategory> list = new ArrayList<>();
        for (int i = 0; i <array1.size() ; i++) {
            JSONObject jsonObject = array1.getJSONObject(i);
            ProductCategory productCategory = new ProductCategory();
            productCategory.setProductCategoryId(jsonObject.getString("id"));
            productCategory.setProductCategoryPid(jsonObject.getString("parentId"));
            productCategory.setName(jsonObject.getString("name"));
            productCategory.setLevel(jsonObject.getInteger("level"));
            productCategory.setChildrenFlag(jsonObject.getBoolean("hasChildren"));
            productCategory.setSeqNum(index);
            list.add(productCategory);
            JSONArray firstChildren = JSONArray.parseArray(jsonObject.getString("child"));
            for (int j = 0; j < firstChildren.size() ; j++) {
                JSONObject firstChildrenJSONObject = firstChildren.getJSONObject(j);
                productCategory = new ProductCategory();
                productCategory.setProductCategoryId(firstChildrenJSONObject.getString("id"));
                productCategory.setProductCategoryPid(firstChildrenJSONObject.getString("parentId"));
                productCategory.setName(firstChildrenJSONObject.getString("name"));
                productCategory.setLevel(firstChildrenJSONObject.getInteger("level"));
                productCategory.setChildrenFlag(firstChildrenJSONObject.getBoolean("hasChildren"));
                productCategory.setSeqNum(j);
                list.add(productCategory);
                if(firstChildrenJSONObject.getString("child") != null){
                    JSONArray secondChildren = JSONArray.parseArray(firstChildrenJSONObject.getString("child"));
                    for (int x = 0; x < secondChildren.size() ; x++) {
                        JSONObject secondChildrenJSONObject = secondChildren.getJSONObject(x);
                        productCategory = new ProductCategory();
                        productCategory.setProductCategoryId(secondChildrenJSONObject.getString("id"));
                        productCategory.setProductCategoryPid(secondChildrenJSONObject.getString("parentId"));
                        productCategory.setName(secondChildrenJSONObject.getString("name"));
                        productCategory.setLevel(secondChildrenJSONObject.getInteger("level"));
                        productCategory.setChildrenFlag(secondChildrenJSONObject.getBoolean("hasChildren"));
                        productCategory.setSeqNum(x);
                        list.add(productCategory);
                        if(secondChildrenJSONObject.getString("child") != null){
                            JSONArray thirdChildren = JSONArray.parseArray(secondChildrenJSONObject.getString("child"));
                            for (int y = 0; y < thirdChildren.size() ; y++) {
                                JSONObject thirdChildrenJSONObject = thirdChildren.getJSONObject(y);
                                productCategory = new ProductCategory();
                                productCategory.setProductCategoryId(thirdChildrenJSONObject.getString("id"));
                                productCategory.setProductCategoryPid(thirdChildrenJSONObject.getString("parentId"));
                                productCategory.setName(thirdChildrenJSONObject.getString("name"));
                                productCategory.setLevel(thirdChildrenJSONObject.getInteger("level"));
                                productCategory.setChildrenFlag(thirdChildrenJSONObject.getBoolean("hasChildren"));
                                productCategory.setSeqNum(y);
                                list.add(productCategory);
                            }
                        }
                    }
                }
            }
        }
        System.out.println(list.size());
        boolean results = productCategoryService.saveBatch(list);
        System.out.println(results);
    }


